import React from 'react';
import '../../../css/App.css';
import { useEffect } from "react";
import Navbar from '../../../components/Navbar';
import Footer from '../../../components/Footer';
import { useNavigate } from 'react-router-dom';
import GetUserId from '../../../utils/GetUserId';
import Button from 'react-bootstrap/Button';

const Feedback = () => {
    const userId = GetUserId();
    var userData = undefined;
    let navigate = useNavigate();

    useEffect(() => {
        if(sessionStorage.getItem('feedbackData') == null) {
            userData = "";
            window.sessionStorage.setItem('feedbackData', JSON.stringify(userData));
        }
        else {
            userData = JSON.parse(window.sessionStorage.getItem('feeedbackData'));
            
        }
        setTextAreaData();       
      },[])



    function Submit() {       
        saveData();  
        const data = {
            userId: userId,
            pixelData: JSON.parse(window.sessionStorage.getItem('pixelData')),
            rankData: JSON.parse(window.sessionStorage.getItem('rankData')),
            questionaireData: JSON.parse(window.sessionStorage.getItem('questionaireData')),
            feedbackData: JSON.parse(window.sessionStorage.getItem('feedbackData')),
            ageAndGenderData: JSON.parse(window.sessionStorage.getItem('ageAndGenderData')),
        }       

        fetch("https://stormy-plains-42247.herokuapp.com/submit", {
            mode: "cors",
            method: "POST",
            headers: {
                'Content-type': "application/json"
            },
            body: JSON.stringify(data)
        }).then(function(response) {
            return response.json();
        });
        navigate('/survey/submit') 
    }

    function Previous() {
        saveData();
        navigate('/survey/image-questionaire') 
    }

    function saveData() {
        userData = document.getElementById("textArea").value;
        window.sessionStorage.setItem('feedbackData', JSON.stringify(userData));
    }

    function setTextAreaData() {
        document.getElementById("textArea").value = userData;
    }

return (
    <div id="Survey_Feedback">
        <div className="main-container">
            <div className="header">
                <Navbar/>
            </div>
            <div className="container">
                <div className="content" style={{textAlign: "center"}}>
                <div>
                    <h1>Feedback</h1>
                    <br>
                    </br>
                    <h4>(Inte obligatoriskt att svar)</h4>
                    <br>
                    </br>
                    <br>
                    </br>
                    </div>
                    <div className="feedback">             
                        <label>Övriga kommentarer? (T ex att frågorna var svårtolkade, otydliga instruktioner, tekniska problem eller andra åsikter)</label>
                        <textarea id="textArea"></textarea>                
                    </div>
                    <div>
                    <p><i>När du känner dig färdig med enkäten kan du klicka nedan på knappen "Skicka in")</i></p>
                    <Button id="Previous-button-part4" style={{ marginBottom: "20px", marginRight: "20px", marginLeft: "20px", width: "90px"}} variant="outline-secondary" onClick={Previous}>Tillbaka</Button>
                    <Button id="Next-button-part4" style={{ marginBottom: "20px", marginRight: "20px", marginLeft: "20px", width: "90px"}} variant="outline-secondary"onClick={Submit}>Skicka in</Button>
                    </div>
                </div> 
                <Footer/>
            </div>
        </div>
    </div>
    )   
}



export default Feedback;
